drop database if exists ecommerce;
create database ecommerce;
use ecommerce; 
drop table if exists product_listing;
create table product_listing(

product_id int not null,
user_id int not null,
product_name varchar(256) not null,
category enum("Fashion", "Fitness", "Stationary", "arts" , "Other") not null,
brand_name varchar(256),
price int


);

drop table if exists user_data;
create table user_data(
user_id int not null primary key,
user_name varchar(256) not null,
gender enum("M", "F"),
phone_number bigint not null,
category enum("Gold", "Silver", "Bronze")
);


drop table if exists order_management;
create table order_management(
product_id int not null,
user_id int not null,
price int not null,
order_date date,
exp_del_date date,
status_ofdel varchar(256) not null
);


drop table if exists inventory;
create table inventory(
product_id int not null,
product_category varchar(256),
stock int not null
);





);





